sourcesContent:
import styled from 'styled-components';

export const ButtonWrapper = styled.div`
    padding: 20px 0;
    margin-top: 140px;  
    margin-left: auto;
    argin-right: auto;
`

export const Item = styled.div`
    overflow: auto;
    padding: 20px 0;
    margin-top: 140px;
    .pic {
        display: block;
        width: 125px;
        height: 100px;
        border-radius: 10px;
        border-style: solid;
        margin-left: auto;
        margin-right: auto;    
    }
`
